        function normalizeLineEndings(csvString) {
    return csvString.replace(/\r\n|\r/g, "\n");  // Normalize to Unix-style line endings
}

function trimCSVContent(csvString) {
    return csvString
        .split("\n") // Split by lines
        .map(line => line.trim()) // Trim spaces from each line
        .filter(line => line !== "") // Remove empty lines
        .join("\n"); // Join the lines back
}



        function parseCSV(data) {
            const rows = data.split('\n');
            const dates = [];
            const temperatures = [];
            rows.forEach((row, index) => {
                const columns = row.split(',');
                if (index === 0 || columns.length < 2) return; // Skip header or invalid rows
                dates.push(columns[0].trim());
                temperatures.push(parseFloat(columns[1].trim()));
            });
            return { dates, temperatures };
        }

        function splitDataByDay(data, parts) {
            const { dates, temperatures } = data;
            const groupedData = [];
            let currentGroup = { dates: [], temperatures: [] };
            let lastDate = null;

            // Group data by day (ignoring time)
            dates.forEach((date, index) => {
                const currentDate = date.split(' ')[0]; // Get the date part (dd/mm/yyyy)
                if (lastDate && currentDate !== lastDate) {
                    groupedData.push(currentGroup);
                    currentGroup = { dates: [], temperatures: [] }; // Start new group for new day
                }
                currentGroup.dates.push(date);
                currentGroup.temperatures.push(temperatures[index]);
                lastDate = currentDate;
            });
            groupedData.push(currentGroup); // Push the last group

            // Split the grouped data into parts
            const totalDays = groupedData.length;
            const daysPerPart = Math.ceil(totalDays / parts);
            const dividedData = [];

            // console.log("Target days per part", daysPerPart)
            let longestGraph = 0;
            let shortestGraph = 999999999999;
            let numberOfDaysPerGraph = 0;
            for (let i = 0; i < parts; i++) {
                const start = i * daysPerPart;
                const end = start + daysPerPart;
                const part = {
                    dates: [],
                    temperatures: []
                };

                numberOfDaysPerGraph = 0;
                // Combine all days for each part
                for (let j = start; j < end && j < totalDays; j++) {
                    part.dates = part.dates.concat(groupedData[j].dates);
                    part.temperatures = part.temperatures.concat(groupedData[j].temperatures);
                    numberOfDaysPerGraph = numberOfDaysPerGraph +1;
                }

                if (shortestGraph > numberOfDaysPerGraph) {shortestGraph = numberOfDaysPerGraph};
                // console.log("Days per part", numberOfDaysPerGraph);
                dividedData.push(part);
            }
            // console.log("Shortest graph", shortestGraph);

            let returnData = dividedData;
            let maxDays = daysPerPart;
            let minDays = shortestGraph;
            // return dividedData;
            return {returnData,maxDays,minDays};
        }

// Function to parse date from 'dd/mm/yyyy hh:mm' format to a Date object
function parseDate(dateStr) {
    // Split the date into day, month, year, hour, minute
    const [day, month, year, hour, minute] = dateStr.split(/[\/ :]/);

    // Construct a new date string in the format 'yyyy-mm-ddThh:mm:ss'
    const formattedDate = `${year}-${month}-${day}T${hour}:${minute}:00`;

    // Create a JavaScript Date object from the formatted date string
    const date = new Date(formattedDate);

    // If the date is invalid, return null
    return isNaN(date.getTime()) ? null : date;
}

// Format a JavaScript Date object as 'dd/mm/yyyy 00:00'
function formatDate(date) {
    const day = ("0" + date.getDate()).slice(-2);
    const month = ("0" + (date.getMonth() + 1)).slice(-2);
    const year = date.getFullYear();
    return `${day}/${month}/${year} 00:00`; // Ensuring the time is always at 00:00
}

function get12And24HourLines(dates) {
    const verticalLines24 = [];
    const verticalLines12 = [];
    let lastDate24 = null;

    dates.forEach((date) => {
        const dateParts = date.split(' ');
        const dateArray = dateParts[0].split('/');
        const timeArray = dateParts[1].split(':');

        const parsedDate = new Date(
            `${dateArray[1]}/${dateArray[0]}/${dateArray[2]} ${timeArray[0]}:${timeArray[1]}`
        );

        const currentDate = parsedDate.toISOString().split('T')[0]; // Get YYYY-MM-DD

        // Check for 24-hour intervals (midnight, 00:00)
        if (parsedDate.getHours() === 0 && parsedDate.getMinutes() === 0 && currentDate !== lastDate24) {
            verticalLines24.push(date); // Add vertical line at midnight
            lastDate24 = currentDate; // Update last 24-hour date
        }

        // Check for 12-hour intervals (noon, 12:00 only)
        if (
            parsedDate.getHours() === 12 &&
            parsedDate.getMinutes() === 0
        ) {
            verticalLines12.push(date); // Add vertical line at 12:00 only
        }
    });

    return { verticalLines24, verticalLines12 };
}

function plotDividedData(dividedData) {
    // Clear existing charts if any
    charts.forEach(chart => chart.destroy());
    charts = [];

    dividedData.forEach((part, index) => {
        const { verticalLines24, verticalLines12 } = get12And24HourLines(part.dates);

        // console.log("24-hour lines:", verticalLines24);
        // console.log("12-hour lines:", verticalLines12);

        const annotations = [
            ...verticalLines24.map((value) => ({
                type: 'line',
                mode: 'vertical',
                scaleID: 'x',
                value,
                borderColor: 'rgba(255, 0, 0, 0.5)', // Red color for 24-hour lines
                borderWidth: 1,
            })),
            ...verticalLines12.map((value) => ({
                type: 'line',
                mode: 'vertical',
                scaleID: 'x',
                value,
                borderColor: 'rgba(0, 0, 0, 0.5)', // Black color for 12-hour lines
                borderWidth: 1,
                borderDash: [5, 5], // Dotted line style
            }))
        ];

        const chart = new Chart(ctxs[index], {
            type: 'line',
            data: {
                labels: part.dates,
                datasets: [{
                    label: `Part ${index + 1} Temperature (C)`,
                    data: part.temperatures,
                    borderColor: 'rgba(75, 192, 192, 1)',

                    borderWidth: 1,
                    pointRadius: 2,
                }]
            },

                        },

                        }
                    },

                        max: 38.5, // Set maximum y-axis value

                        }
                    }
                },
                plugins: {
                    annotation: {
                        annotations,
                    }
                }
            }
        });
        charts.push(chart);
    });
}
